import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the specific video container with data-video-id='1'
    const videoContainerSelector = 'div.video-container[data-video-id="1"]';
    await page.waitForSelector(videoContainerSelector);

    // Locate the volume slider within the video container
    const volumeSliderSelector = `${videoContainerSelector} .volume-slider`;
    await page.waitForSelector(volumeSliderSelector);

    // Set the volume slider to 50%
    await page.evaluate((selector) => {
      const slider = document.querySelector(selector);
      if (slider) {
        slider.value = 0.5; // Set to 50%
        slider.dispatchEvent(new Event('input')); // Trigger change event
      }
    }, volumeSliderSelector);

    // Take a screenshot after setting the volume
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_volume_set.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_volume_set.png'));

    // Verify the volume is set correctly
    const currentVolume = await page.evaluate((selector) => {
      const slider = document.querySelector(selector);
      return slider ? slider.value : null;
    }, volumeSliderSelector);

    return {
      success: true,
      action: "Set the volume of the first video to 50%",
      extractedData: { currentVolume },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
